import React, { Component } from "react";

export default class OldComments extends Component {
  render() {
    return (
      <section className="">
        <div className="comment-card">
          <div className="comment-card__avatar"></div>
          <div className="comment-card__body">
            <div className="comment-card__body--top">
              <span className="comment-card__body--username">John</span>
              <span className="comment-card__body--date">12/12/12</span>
            </div>
            <span className="comment-card__body--text">
              They BLEW the ROOF off at their last show, once everyone started
              figuring out they were going. This is still simply the greatest
              opening of a concert I have EVER witnessed.
            </span>
          </div>
        </div>
      </section>
    );
  }
}
